'''Vyre noble clothing''' are a set of clothing that is required to be worn to access the bank and shops within [[Darkmeyer]]. It is scented with the blood of a vampyre noble to help blend in with the vampyres, which makes [[Vyrewatch Sentinel]]s unaggressive and NPCs less hostile towards the player.

A [[vyre noble top]], [[Vyre noble legs|legs]] and [[Vyre noble shoes|shoes]] are created during the quest [[Sins of the Father]]. Should players lose this disguise, they can reclaim a set from the chest in the [[Old Man Ral|Old Man Ral's]] house Trapdoor.

Players can buy a greater variety of vyre noble clothing at the [[Darkmeyer Seamstress]], which will also work as a disguise. However, they must be wearing the clothing when buying from the shop.

The original set of vyre noble clothing can be stored in an [[armour case space|armour case]] of a [[player-owned house]] [[costume room]].

